import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

const Dashboard = () => {
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [filterValue, setFilterValue] = useState('');

  useEffect(() => {
    const loadData = async () => {
      try {
        const response2023 = await fetch('/dados2023.csv'); // Ajuste o caminho aqui
        const text2023 = await response2023.text(); // Extrai o texto

        const response2024 = await fetch('/dados2024.csv'); // Ajuste o caminho aqui
        const text2024 = await response2024.text(); // Extrai o texto

        // Parsing the CSV files
        Papa.parse(text2023, {
          header: true,
          complete: (results) => {
            setData(prevData => [...prevData, ...results.data]);
            setFilteredData(prevData => [...prevData, ...results.data]); // Inicializa os dados filtrados
          },
        });

        Papa.parse(text2024, {
          header: true,
          complete: (results) => {
            setData(prevData => [...prevData, ...results.data]);
            setFilteredData(prevData => [...prevData, ...results.data]); // Inicializa os dados filtrados
          },
        });
      } catch (error) {
        console.error("Error loading the CSV files: ", error);
      }
    };

    loadData();
  }, []);

  // Lógica de filtragem
  useEffect(() => {
    const filtered = data.filter(item => 
      item.NOME_FANTASIA.toLowerCase().includes(filterValue.toLowerCase())
    );
    setFilteredData(filtered);
  }, [filterValue, data]); // Refiltra sempre que filterValue ou data mudar

  return (
    <div>
      <h1>Visão Geral</h1>
      <input
        type="text"
        placeholder="Filtrar por Nome Fantasia"
        value={filterValue}
        onChange={(e) => setFilterValue(e.target.value)} // Atualiza o valor do filtro
      />
      <table>
        <thead>
          <tr>
            <th>CNPJ</th>
            <th>Cód Cliente</th>
            <th>Nome Fantasia</th>
            <th>Razão Social</th>
            <th>Bairro</th>
            <th>Município</th>
            <th>Cód Produto</th>
            <th>Produto</th>
            <th>Embalagem</th>
            <th>QT</th>
            <th>Total</th>
            <th>RCA</th>
            <th>Nome Vendedor</th>
            <th>Nome Supervisor</th>
            <th>Cód Dept</th>
            <th>Departamento</th>
            <th>Cond Venda</th>
            <th>DT FAT</th>
            <th>Segmento</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.length > 0 ? (
            filteredData.map((item, index) => (
              <tr key={index}>
                <td>{item.CNPJ}</td>
                <td>{item.COD_CLIENTE}</td>
                <td>{item.NOME_FANTASIA}</td>
                <td>{item.RAZAO_SOCIAL}</td>
                <td>{item.BAIRRO}</td>
                <td>{item.MUNICIPIO}</td>
                <td>{item.COD_PROD}</td>
                <td>{item.PRODUTO}</td>
                <td>{item.EMBALAGEM}</td>
                <td>{item.QT}</td>
                <td>{item.TOTAL}</td>
                <td>{item.RCA}</td>
                <td>{item.NOME_VENDEDOR}</td>
                <td>{item.NOME_SUPERVISOR}</td>
                <td>{item.COD_DEPTO}</td>
                <td>{item.DEPARTAMENTO}</td>
                <td>{item.COND_VENDA}</td>
                <td>{item.DT_FAT}</td>
                <td>{item.SEGMENTO}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="18">Nenhum dado disponível</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
